import React from 'react';
import {Routes, Route } from "react-router-dom";
import MyHeader from '../header/Header'
import MyFooter from '../footer/Footer'
import MyTours from'../tours/Tours'
import MyTourDetails from '../TourDetails/TourDetails'

function Home({data}) {
    return (
      <Routes>
     <Route MyHeader />
     <Route exact path="/" element={<MyTours data={data} />} />
    <Route exact path={"/tour/:name"} element={<MyTourDetails data ={data} />} />      
     <Route element={<MyTours/>} />
     </Routes>
    )
  }

  export default Home;
